import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import Student from "./components/registration/Student";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Student />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
